insert  into `page_contents`(`id`,`page_id`,`display_name`,`status`,`created_at`,`updated_at`,`content`) values 
(276,6,'A platform that allows employers',NULL,'2021-04-06 06:55:50','2021-04-06 06:55:50','<section class=\"sptb abpad abtsec pb-0\">\n		<div class=\"container\">\n			<div class=\"row\">\n				<div class=\"col-xl-6 col-lg-6 col-md-12\">\n					<div class=\"textsect\">\n						<h2>A platform that allows employers to hire media industry talent &amp; professionals without the help of an agent</h2>\n\n					</div>\n				</div>\n				<div class=\"col-xl-6 col-lg-6 col-md-12\">\n					<div class=\"aboutvid\">\n						<img src=\"../assets/images/phone_img.png\" class=\"img-fluid\" alt=\"\">\n\n					\n\n\n					</div>\n				</div>\n			</div>\n		</div>\n	</section>'),
(277,6,'What we do',NULL,'2021-04-06 06:55:50','2021-04-06 06:55:50','<section class=\"whatwedo bg-white\">\n		<div class=\"container\">\n			<div class=\"row\">\n				<div class=\"col-lg-12 col-xl-12 col-md-12\">\n					<h3 class=\"mb-2\">What we do hhhhh</h3>\n					<p>NoOne 21 is a marketplace for professionals from the media industry to find each other. Talent as well as crew members can be hired straight from this platform. This way we provide an opportunity to media professionals to find work and gain the exposure they need in the industry. </p>\n				</div>\n			</div>\n		</div>\n	</section>'),
(278,6,'What we offer',NULL,'2021-04-06 06:55:50','2021-04-06 06:55:50','<section class=\"whatweoffer\">\n		<div class=\"container\">\n			<div class=\"row\">\n				<div class=\"col-lg-12 col-xl-12 col-md-12\">\n					<h3 class=\"mb-2\">What we offer</h3>\n					<p>We offer talent and industry professionals the chance to get hired and engage with the media industry without the help of an agent. NoOne 21 plays the part of the middle man and offers employers and professionals access to each other. </p>\n				</div>\n			</div>\n		</div>\n	</section>'),
(279,4,'Direct Access',NULL,'2021-04-06 12:14:05','2021-04-06 06:55:50','<section class=\"sptb bg-white featureblk\">\n		<div class=\"container\">\n\n			<div class=\"row \">\n				<div class=\"col-lg-4 col-md-6 col-sm-12\">\n					\n						<div class=\"mb-lg-0 mb-4\">\n							<div class=\"service-card text-center border-red\">\n								<div class=\"icon-bg box-shadow icon-service text-danger about bg-white\">\n									<img src=\"../assets/images/Connect-with-freelancers.png\" class=\"img-fluid\" alt=\"\">\n								</div>\n								<div class=\"servic-data mt-3\">\n									<h4 class=\"font-weight-semibold mb-2\">Direct Access</h4>\n									<p class=\"text-muted mb-0\">Employers and talent both get the chance to connect with each other directly and team up for exciting projects. </p>\n								</div>\n							</div>\n						</div>\n					\n				</div>\n				<div class=\"col-lg-4 col-md-6 col-sm-12\">\n					\n						<div class=\"mb-lg-0 mb-4\">\n							<div class=\"service-card text-center border-red\">\n								<div class=\"icon-bg box-shadow icon-service text-danger about bg-white\">\n									<img src=\"../assets/images/Explore-Options.png\" class=\"img-fluid\" alt=\"\">\n								</div>\n								<div class=\"servic-data mt-3\">\n									<h4 class=\"font-weight-semibold mb-2\">Variety of Options</h4>\n									<p class=\"text-muted mb-0\">With an abundance of professionals all in one place, everyone gets plenty of choices to find great partners.</p>\n								</div>\n							</div>\n						\n					</div>\n				</div>\n				<div class=\"col-lg-4 col-md-6 col-sm-12\">\n					\n						<div class=\"mb-sm-0 mb-4\">\n							<div class=\"service-card text-center border-red\">\n								<div class=\"icon-bg box-shadow icon-service text-danger about bg-white\">\n									<img src=\"../assets/images/Make-a-search.png\" class=\"img-fluid\" alt=\"\">\n								</div>\n								<div class=\"servic-data mt-3\">\n									<h4 class=\"font-weight-semibold mb-2\">Exposure</h4>\n									<p class=\"text-muted mb-0\">Hiring an agent is not easy. With NoOne 21, professionals get the exposure they need without anyone’s help.</p>\n								</div>\n							</div>\n						\n					</div>\n				</div>\n\n			</div>\n		</div>\n	</section>'),
(280,4,'Our Mission',NULL,'2021-04-06 12:13:57','2021-04-06 06:55:50','<div class=\"doc_content bg-white ourteam\">\n		<div class=\"container\">\n			<div class=\"row ptb border-bottom\">\n				\n				<div class=\"col-xl-6 col-lg-6 col-md-12 order-md-2 order-sm-2 order-first\">\n					<div class=\"cont_right\">\n						<img src=\"../assets/images/about-image.jpg\" class=\"img-fluid\" alt=\"\">\n					</div>\n				</div>\n				<div class=\"col-xl-6 col-lg-6 col-md-12 order-md-1 order-sm-1 order-last\">\n					<div class=\"cont_left\">\n						<h2 class=\"mb-5\">Our Mission </h2>\n						\n							<p>NoOne 21 aims to offer solutions to age-old issue of accessibility and exposure in the media industry taking complete advantage of digital tools. We believe in evolving systems and processes to increase efficiency, productivity and to allow creatives to earn from their talents. </p>\n						<a href=\"/pages/vendor-register\" class=\"btn btn-danger gradient mt-4 mb-4\"><span>Sign Up</span></a>\n\n					</div>\n				</div>\n				\n			</div>\n\n		</div>\n	</div>'),
(293,8,'All Categories',NULL,'2021-04-06 14:13:59','2021-04-06 14:13:59','<div class=\"bg-white\">\n    <section class=\"allcat_sect\">\n        <div class=\"container\">\n            <div class=\"row\">\n                <div class=\"col-lg-12 col-xl-12 col-md-12 col-sm-12 col-12\">\n                    <h2 class=\"text-center\">All Categories</h2>\n                    <div class=\"card-columns\">\n                        <ng-container *ngfor=\"let item of categories\">\n\n                            <div class=\"catbox\">\n                                <h4 class=\"cursor-pointer\">\n                                    <a href=\"/pages/vendor-list/{{item?.slug}}\">{{item?.name}}</a>\n                                    <span class=\"float-right\">({{item?.count}})</span></h4>\n                                <ul>\n                                    <ng-container *ngfor=\"let sub of item?.sub_categories\">\n                                        <li><a href=\"/pages/vendor-list/{{item?.slug}}/{{sub?.slug}}\">{{sub?.name}} <span class=\"float-right\">({{sub?.count}})</span></a></li>\n                                    </ng-container>\n                                </ul>\n                            </div>\n\n                        </ng-container>\n                    </div>\n                </div>\n            </div>\n        </div>\n    </section>\n</div>'),
(350,7,'Find work and hire talent. sajid',NULL,'2021-04-07 17:10:11','2021-04-07 17:10:11','<section class=\"sptb abpad\">\n		<div class=\"container\">\n			<div class=\"row\">\n				<div class=\"col-xl-6 col-lg-6 col-md-12\">\n					<div class=\"textsect\">\n						<h2 class=\"mb-4\">Find work and hire talent. Team up with professionals from the media industry. </h2>\n						<p>NoOne21 allows creatives to come together and deliver the best work they can. Writers, directors, editors, actors, camera crew can all find each other on this platform and get together to make the best kind of art!</p>\n						<p>It offers a quick and efficient way to find and hire the best kind of talent the media industry has to offer. With a sophisticated search system you can find professionals whose skills and profile perfectly fit your criteria.</p>\n					</div>\n				</div>\n				<div class=\"col-xl-6 col-lg-6 col-md-12\">\n					<div class=\"aboutvid\">\n						<img src=\"../assets/images/howitimg.jpg\" class=\"img-fluid\" alt=\"\">\n						<div class=\"ovrlay\">\n							<a href=\"javascript:void(0)\" (click)=\"openModal(template)\"><img src=\"../assets/images/video_icon.png\" class=\"img-fluid\" alt=\"\"></a>\n						</div>\n\n\n\n					</div>\n				</div>\n			</div>\n		</div>\n	</section>'),
