(379,11,'s',NULL,'2021-04-07 19:06:18','2021-04-07 19:06:18','<section class=\"drinkinstr bg-white pt70\">\n    <div class=\"container\">\n        <div class=\"row justify-content-center\">\n            <div class=\"col-lg-8 col-md-12 col-sm-12 col-12 pr-8\">\n                <div class=\"drinkleft\">\n                    <h3>Learn through Work </h3>\n                    <p>Nothing comes close to learning on a job. That is the kind of experience that will help your career.</p>\n\n\n                    <p>Any job you apply for you will be asked about the experience you have in the field. While it is true that you cannot gain experience until you have actually had a job and this problem can make it seem like a vicious cycle that you are stuck in, there is a way out: unpaid work. </p>\n\n\n                    \n                        <img src=\"../assets/images/channel_tips/1-%20Learn%20through%20Work.jpg\" class=\"img-fluid\" alt=\"\">\n                \n\n                    <p>Before you run the other way, hear us out. The best thing to do is get the experience when you have that margin. A lot of people go for unpaid internships when they are studying. So if you are in such a position, or maybe you have a job but can spare some time for unpaid work, do it for the experience. </p>  \n\n\n\n                </div>\n                <div class=\"hbtns\">\n                    <a href=\"#\" class=\"btn-danger btn gradient\"><span>Back to Tips</span></a>\n                    <a href=\"#\" class=\"btn-danger btn gradient\"><span>Find Service Provider</span></a>\n                </div>\n            </div>\n            \n        </div>\n    </div>\n</section>'),
