(384,10,'s',NULL,'2021-04-07 19:19:53','2021-04-07 19:19:53','<section class=\"drinkinstr bg-white pt70\">\n    <div class=\"container\">\n        <div class=\"row justify-content-center\">\n            <div class=\"col-lg-8 col-md-12 col-sm-12 col-12 pr-8\">\n                <div class=\"drinkleft\">\n                    <h3>Your Code of Ethics </h3>\n                    <p>Your ethos or code of ethics will guide you through your professional career and let your clients know you mean business.</p>\n\n\n                    <p>Having a set of rules for yourself that you stick with will inform and guide the decision you take as a professional.</p>\n\n\n                    \n                        <img src=\"../assets/images/channel_tips/2-%20Your%20Code%20of%20Ethics.jpg\" class=\"img-fluid\" alt=\"\">\n                \n\n                    <p>When working as a freelancer and in isolation, it can be very difficult to know if what you are doing is right and if it is the same as what others in the industry do or not.   </p>\n\n\n                    <p>To deal with this the best thing you can do for yourself is to devise a code of do’s and don’ts according to what seems right to you. This not only makes things easier for the professional but also inspires confidence in the employer and tells them that you know what you are doing and that you will maintain certain standards of professionalism.</p>  \n\n\n\n                </div>\n                <div class=\"hbtns\">\n                    <a href=\"#\" class=\"btn-danger btn gradient\"><span>Back to Tips</span></a>\n                    <a href=\"#\" class=\"btn-danger btn gradient\"><span>Find Service Provider</span></a>\n                </div>\n            </div>\n            \n        </div>\n    </div>\n</section>');
